create or replace TEMP view aggView9168630297939744110 as select p_partkey as v6, p_brand as v9, p_type as v10, p_size as v11 from part as part where (p_brand <> 'Brand#45') and (p_type NOT LIKE 'MEDIUM POLISHED%') and (p_size IN (49,14,23,45,19,3,36,9));
create or replace TEMP view aggJoin1651174036466754022 as select v9, v10, v11 from partsupp as partsupp, aggView9168630297939744110 where partsupp.ps_partkey=aggView9168630297939744110.v6;
create or replace TEMP view res as select v9, v10, v11, COUNT(*) as v15 from aggJoin1651174036466754022 group by v9, v10, v11;
